import React from 'react';
import Common from './Common';
import shadows from "../src/img/web.png    "
const About = ()=>{
  return (
    <>
    <Common name="We are providng world wide services." imgsrc={shadows} btnname="Search" visit="/" />
    </>
  )
}

export default About;
